import Web3 from "web3";

let web3;

if (typeof window !== "undefined" && typeof window.web3 !== "undefined") {
    //in browser and metamask up and running
    console.log('Metamask');
    web3 = new Web3(window.web3.currentProvider);
} else {
    console.log("Error!")
}

export default web3;
